CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_insert_cliente` (IN `nombre_` VARCHAR(50), IN `apellido_` VARCHAR(60), IN `telefono_` VARCHAR(20), IN `dni_` VARCHAR(20), IN `email_` VARCHAR(120), IN `password_` VARCHAR(200))  NO SQL
BEGIN
SELECT @existe := (SELECT COUNT(*) FROM persona WHERE email = email_);
IF @existe = 0 THEN 
    IF (SELECT COUNT(*) FROM cliente WHERE dni = dni_) = 0 THEN 
        INSERT INTO persona (nombre, apellido, telefono, email, password, estado) 
        VALUE (nombre_, apellido_, telefono_, email_, password_, 1);
        SELECT @id_ultimo_cliente := @@identity AS idpersona; 
        INSERT INTO cliente (idpersona, dni) VALUE (@id_ultimo_cliente, dni_);
    ELSE SELECT 'existe';
    END IF; 
ELSE SELECT 'existe';
END IF; 
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_insert_usuarios` (IN `nombre_` VARCHAR(50), IN `apellido_` VARCHAR(60), IN `telefono_` VARCHAR(20), IN `rol_` VARCHAR(20), IN `email_` VARCHAR(120), IN `password_` VARCHAR(200))  NO SQL
BEGIN 
SELECT @existe := (SELECT COUNT(*) FROM persona WHERE email = email_);
IF @existe = 0 THEN 
	INSERT INTO persona (nombre, apellido, telefono, email, password, estado) 
    VALUE (nombre_, apellido_, telefono_, email_, password_, 1);
    SELECT @id_ultimo_cliente := @@identity AS idpersona; 
    INSERT INTO usuario (idpersona, rol) VALUE (@id_ultimo_cliente, rol_);
ELSE SELECT 'existe';
END IF; 
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `pa_login` (IN `email_` VARCHAR(120), IN `password_` VARCHAR(200))  BEGIN
IF (SELECT COUNT(*) FROM persona p INNER JOIN cliente c ON c.idpersona = p.idpersona WHERE p.email = email_ AND p.password = password_) > 0 THEN
	SELECT p.idpersona, p.nombre, p.apellido, p.email, p.telefono, p.estado, c.idcliente, c.dni 
    FROM persona p INNER JOIN cliente c ON c.idpersona = p.idpersona 
    WHERE p.email = email_ AND p.password = password_;
    
ELSEIF (SELECT COUNT(*) FROM persona p INNER JOIN usuario u ON u.idpersona = p.idpersona WHERE p.email = email_ AND p.password = password_) > 0 THEN
	SELECT p.idpersona, p.nombre, p.apellido, p.email, p.telefono, p.estado, u.idusuario, u.rol 
    FROM persona p INNER JOIN usuario u ON u.idpersona = p.idpersona
	WHERE p.email = email_ AND p.password = password_;
    
END IF; 
END$$

